import React from "react";
import './App.css';
import DashboardCosmetique from "./Component/Pages/DashboardCosmetique/DashboardCosmetique";
import DashboardMode from "./Component/Pages/DashboardMode/DashboardMode";
import {Route, Routes} from "react-dom"

export default function App() {
  return (
   <Routes>
      <Route path="/" exact component={DashboardCosmetique} />
          <Route
            path="/dashboardMode"
            exact
            component={DashboardMode}
          />
      </Routes>

  );
}
